    checkUser = () => {
        if (this.props.oktaAuth.getUser()) {
            const user = this.props.oktaAuth.getUser()
            console.log(user)
        }
    }


    render() {



        return(
            <div>
                <h3>Welcome</h3>
                {this.checkUser()}
                <div>You have reached the home page of BenCo Financial Services. </div>
                <div>Select Login to log into your account</div>

            </div>


        )
    }
})
